import React, { useEffect, useState } from 'react';

const Dashboard = () => {
    const [userData, setUserData] = useState({
        painIntensity: '',
        painLocation: ''
    });
    const [error, setError] = useState('');

    useEffect(() => {
        const token = localStorage.getItem('token');
        const painIntensity = localStorage.getItem('painIntensity');
        const painLocation = localStorage.getItem('painLocation');
        const username = localStorage.getItem('username');

        if (!token || !username) {
            setError('User is not authenticated');
            return;
        }

        setUserData({ painIntensity, painLocation });
    }, []);

    return (
        <div>
            <h1>Today's Therapy</h1>
            <p>Date: {new Date().toLocaleDateString()}</p>
            {error ? (
                <p>{error}</p>
            ) : (
                <>
                    <p>Pain Intensity: {userData.painIntensity}</p>
                    <p>Pain Location: {userData.painLocation}</p>
                </>
            )}
        </div>
    );
};

export default Dashboard;
